import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';



class App extends Component {
  constructor(props){
    super(props)

    this.state = {
      emailLogin: '',
      passwordLogin: '',
      userCreate: {
        name: '',
        email: '',
        lastName: '',
        password: '',
      }
    }
  } 

  componentDidMount(){

  }

  register = () => {
    alert('Registrando');
  }

  login = () => {
    let { userLogin } = this.state;

    console.log(userLogin);
  }

  render(){
    return (
      <body className="truman">
        <header className="truman__header">
          <h1>Truman Health</h1>
        </header>
        <div className="truman__body">
          <div style={{paddingLeft: 20, display: 'flex', justifyContent: 'space-between', width: '500px'}}>
            <div>
              <h2>Register</h2> 
              <input type="text" placeholder="Name" name="name" onChange={(e) => {
                console.log(e);
              }}/>
              <br/><br/>
              <input type="text" placeholder="Last Name" name="last_name"/>
              <br/><br/>
              <input type="email" placeholder="Email" name="email"/>
              <br/><br/>
              <input type="password" placeholder="Password" name="password"/>
              <br/><br/>
              <button style={{width: '100%', height: '35px'}} onClick={this.register}>Register</button>
            </div>

            <div>
              <h2>Login</h2>
              <input type="text" placeholder="email" name="email" value={this.state.emailLogin} onChange={(e) => {
                this.setState({emailLogin: e.currentTarget.value})
              }}/>
              <br/><br/>
              <input type="password" placeholder="Password" name="password" value={this.state.passwordLogin} onChange={(e) => {
                this.setState({passwordLogin: e.currentTarget.value})
              }}/>
              <br/><br/>
              <button style={{width: '100%', height: '35px'}} onClick={this.login}>Login</button>
            </div>
          </div>

        </div>
        <footer className="truman__footer">

        </footer>
      </body>
    )
  }
}

export default App;
